import './balance-button.css';
import React from 'react'
import { Link } from "react-router-dom";

export default function BalanceButton() {

    return (
        <div class="balance-button-parent">
        <Link to="/Balance">
        <button className="balance-button">Balance</button>
        </Link>
        </div>
    );
  }
